import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Video, {Grid} from './App';

const root = document.getElementById('root');

ReactDOM.render(
  <>
  <div className="container">

    <Video></Video>
    <Grid></Grid>
  </div>
  </>, root
)

const borderBottom = document.querySelectorAll('.box');
const borderLeft = document.querySelectorAll('.box');

for (let i = 90; i < borderBottom.length; i++) {
  borderBottom[i].classList.add('border-bottom');
}
for (let i = 0; i < borderLeft.length; i++) {

  if (i % 10 === 0) {
    borderLeft[i].classList.add('border-left');
  }

}
